//import './App.css';

const todos = [
  {text: 'Cortar cebolla', completed: false},
  {text: 'Tomar curso', completed: false},
  {text: 'Correr', completed: false}
]


function App(props) {
  return (
   <div>
      <TodoCounter />
      <h2>Has completado 2 de 3 TODOs</h2>

      <TodoSearch />
      <input placeholder="Cebolla"/>

      <TodoList>
        {todos.map(todo => (
          <TodoItem />
        ))}
      </TodoList>

      <CreateTodoButton />
      <button>+</button>
   </div>
  );
}

export default App;
